    public static String convertTopic2Mongo(String originText) {
        JSONObject data;
        try {
            JSONObject jsonData = JSONObject.parseObject(originText);
            String AccessReportData = jsonData.getString("data");
            // 外层信息
            String billno = jsonData.getString("messageId");
            String addtime = jsonData.getString("timestamp");
            // 请求信息
            JSONObject properties = JSONObject.parseObject(jsonData.getString("properties"));
            String idCard = properties.getString("idCard");
            String channel = properties.getString("data_type");
            String name = properties.getString("name");
            String phone = properties.getString("mobile");
            String triggerStrategy = properties.getString("triggerStrategy");
            String provider = properties.getString("provider");
            // 按照mongo格式重新组装消息体并返回元组(info,triggerStrategy,provider)
            JSONObject req = new JSONObject();
            req.put("idCard", idCard);
            req.put("channel", channel);
            req.put("name", name);
            req.put("phone", phone);

            JSONObject _id = new JSONObject();
            _id.put("$oid", billno);

            data = new JSONObject();
            data.put("AccessReportData", AccessReportData);
            data.put("idCard", idCard);
            data.put("channel", channel);
            data.put("name", name);
            data.put("phone", phone);
            data.put("addtime", addtime);
            data.put("req", JSONObject.toJSONString(req));
            data.put("_id", _id);
            // 返回

        } catch (Exception e) {
            e.printStackTrace();
            return null;
        }
        return JSONObject.toJSONString(data);

    }


